response.activities:
ГО «Центр правових наукових досліджень» є некомерційним недержавним об’єднанням вчених-юристів, діяльність якого спрямована на розвиток юридичної науки в Україні.


ГО «Центр правових наукових досліджень» був заснований у 2008 році групою науковців, які представляли київську наукову школу права.


Головні завдання ЦПНД:

•організація наукових конференції;
•проведення круглих столів, засідань, семінарів, тренінгів з актуальних правових питань;
•науковий аналіз перспективного законодавства України;
•здійснення комплексних наукових дослідження стану правового регулювання важливих сфер суспільних відносин як приватного, так публічного характеру;
•надання організаційної та інформаційної підтримки молодим науковцям-юристам (студентам, аспірантам, здобувачам);
•видання наукової, публіцистичної та довідкової юридичної літератури;
•здійснення тлумачення діючого законодавства України шляхом видання науково-практичних коментарів;
•співпраця з науковими юридичними організаціями інших держав.

response.interests:
Сфери дослідження ЦПНД







•актуальні проблеми цивільно-правового регулювання обігу товарів та послуг, спадкового права, захисту прав власників;
•конституційна реформа в Україні, актуальні питання виборчого права;
•актуальні проблеми корпоративного права, банкрутства, боротьби з рейдерськими атаками;
•адміністративна реформа в Україні, практика діяльності адміністративних судів;
•актуальні проблеми кримінального права та процесу, кримінології та криміналістики;
•реформування трудового законодавства України, пенсійна реформа в Україні; 
•правові засоби захисту та охорони навколишнього природного середовища, правове регулювання земельних відносин.Форми діяльності ЦПНД:


•наукові конференції, круглі столі, тренінги, семінари, форуми;
•засідання секцій ЦПНД;
•засідання Ради ЦПНД;
•надання аналітичних довідок за результатами аналізу перспективного законодавства України;
•участь членів організації у роботі громадських, координаційних рад при органах державної влади та місцевого самоврядування;
•розробка проектів законів та інших нормативно-правових актів;
•видання наукової, довідкової, публіцистичної юридичної літератури.
